import React from 'react';
import DataContext from '../Contexts/dataContext'
import DataProvider from '../Providers/dataProvider'

export default function () {
    return (
        <>
            <DataProvider>
                <DataContext.Consumer>
                    {({ isHeightWeight }) => {
                        isWeightHeight.map((value) =>
                        (
                            ((value.height != null && value.weight != null) || (value.height !== 0 && value.weight !== 0)) ?

                                < >
                                    {console.log(value)}
                                    {console.log(value.height)}
                                    {console.log(value.weight)}
                                    <p>{value.height}</p>
                                    <p>{value.weight}</p>
                                </>
                                :
                                <>
                                    {/* {console.log(value)}
                                     {console.log(value.height)}
                                     {console.log(value.weight)} */}
                                </>
                            // console.log(value)
                        ))
                    }
                    }
                </DataContext.Consumer>
            </DataProvider>
        </>
    );
}
